import React from 'react';
import '../css/Projects.css'; // Ensure you have this CSS file for styling

const projects = [
    { title: 'Realtime Analysis', description: 'Python project for real-time data analysis.', link: 'https://github.com/yourusername/realtime-analysis' },
    { title: 'Customer-Churn-Prediction', description: 'Predicts customer churn using Python.', link: 'https://github.com/yourusername/Customer-Churn-Prediction' },
    { title: 'SalesPrediction', description: 'Predicting customer behavior to different prices.', link: 'https://github.com/yourusername/SalesPrediction' },
    { title: 'Federated Learning on MNIST Database', description: 'Federated learning for MNIST dataset using Jupyter Notebook.', link: 'https://github.com/yourusername/federated-learning-on-mnist-database' },
    { title: 'Energy-Aware Coverage Control and Information Learning', description: 'Python project focused on energy-aware coverage control.', link: 'https://github.com/yourusername/Energy-Aware-Coverage-Control-and-Information-Learning-' },
    { title: 'Privacy-Preserving on Cifar-10', description: 'Privacy-preserving methods on the Cifar-10 dataset using Python.', link: 'https://github.com/yourusername/Privacy-preserving-on-Cifar-10' },
    { title: 'Air Quality Forecasting', description: 'Forecasting air quality using Jupyter Notebook.', link: 'https://github.com/yourusername/Air-Quality-forecasting' },
    { title: 'Good Neighbour Challenge', description: 'Community volunteering application, forked from tester-1226/cm.', link: 'https://github.com/yourusername/goodneighbourchallenge' },
    { title: 'Credit Card Fraud Detection', description: 'Detecting credit card fraud using Jupyter Notebook.', link: 'https://github.com/yourusername/credit-card-fraud-detection' },
    { title: 'Stock Price Prediction', description: 'Predicting stock prices using Jupyter Notebook.', link: 'https://github.com/yourusername/stock-price-prediction' },
    { title: 'Cloud Hospital Readmissions', description: 'Predicting hospital readmissions using Jupyter Notebook.', link: 'https://github.com/yourusername/cloud-hospital-readmissions' },
    { title: 'FPS VR Shooting', description: 'Client-server based VR shooting experience using ASP.NET.', link: 'https://github.com/yourusername/FPS-VR-SHOOTING' },
    { title: 'P2P Communication', description: 'Peer-to-peer communication system using C++.', link: 'https://github.com/yourusername/P2P-communication' },
    { title: 'UGA Hacks 8 - Travel Weather Application', description: 'Travel weather application built with HTML.', link: 'https://github.com/yourusername/UGA-Hacks-8---travel-weather-application' },
    { title: 'Mushroom Classification', description: 'Data science project for mushroom classification using Jupyter Notebook.', link: 'https://github.com/yourusername/Mushroom-classification' },
    { title: 'Job Drop Analysis', description: 'Analyzing job drop data using R.', link: 'https://github.com/yourusername/job-drop-analysis' },
    { title: 'Plant vs Zombies Local', description: 'Java-based implementation of the Plant vs Zombies game.', link: 'https://github.com/yourusername/plantvszombieslocal' },
    { title: 'Java Quiz App', description: 'Quiz application built in Java.', link: 'https://github.com/yourusername/java-quiz-app' },
    { title: 'Color Detection', description: 'Color detection project using Python.', link: 'https://github.com/yourusername/color-detection' },
];

const Projects = () => {
  return (
    <div className="projects-container">
      <h1 className="projects-title">Projects</h1>
      <div className="projects-list">
        {projects.map((project, index) => (
          <div className="project-card" key={index}>
            <h2 className="project-title">{project.title}</h2>
            <p className="project-description">{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer" className="project-link">View Project</a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
